import React,{Component} from 'react';
import {Link} from 'react-router-dom';
//import cookie from 'react-cookies';
//import {Redirect} from 'react-router';

class Navbar extends Component {


    render(){

        return(
            <div>
                <nav class="Navbar-div">
                <div class="container-fluid">
                    <div class="navbar-header">
                        <a class="Navbar navbar-brand navbar-nav" href=""></a>
                    </div>
                    <ul class="nav navbar-nav">
                        <li class="active"><Link to="/home">Home</Link></li>
                        <li><Link to="/create">Add a Book</Link></li>
                        <li><Link to="/delete">Delete a Book</Link></li>
                    </ul>
                    <ul class="nav navbar-nav navbar-right">
                        <li><svg xmlns="http://www.w3.org/2000/svg"></svg><Link to="/">Cart</Link></li>
                </ul>
                </div>

            </nav> 
            </div>

        )
    }

}

export default Navbar;

